import React, { Component } from 'react';
import _ from 'loadash'

class Menu extends Component {
    constructor(props){
        super(props);
        this.state = {
            arr1 : [12, 13, 14, 15, 16]
        }
    }

    printState = () => {
        return this.state.arr1.map((arr) => {
            return arr + 100;
        })

    }
    render() { 
        return ( 
            <div>
                {this.printState()}
            </div>
         );
    }
}

export default Menu;
